const mongoose=require("mongoose"),sportSchema=new mongoose.Schema({icon:String,banner:String,externalId:Number,sportId:Number,displayName:{type:String,required:!0},position:{type:Number,default:1},provider:{type:String,default:"Manual"},minBet:{type:Number,default:0},maxBet:{type:Number,default:0},bettingStatus:{type:Number,default:0},sportStatus:{type:String,enum:["active","inactive"],default:"active"}},{timestamps:!0});module.exports=mongoose.model("Sport",sportSchema);